?><p align="justify"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">В 1907 году, часовщик и предприниматель Юлиус Эппле, открывает фабрику по производству хронографов в немецком городе Пфорцхайме. Целых три поколения успешно занимались семейным бизнесом. Но только после 1998 года удалось решить все проблемы, связанные с производством. Ганс Йорг Фольмер возрождает производство и при этом он ставит цель сделать из Aristo знаменитую торговую марку. Главной мечтой нового владельца было создать отдельную линию часов, которые можно было бы надевать абсолютно в любых условиях. И он смог этого добиться. В течение нескольких лет были созданы коллекции для моряков, пилотов и подводников. Но несмотря на то, что на российском рынке часы этой компании появились относительно недавно, этот бренд очень хорошо ценится в среде настоящих знатоков и людей, которые обладают тонким вкусом. 
